export default class CreateUsers extends Component {
    constructor(props){
        super(props);

        this.onChangeUsername = this.onChangeUsername.bind(this);
        this.onSubmit = this.onSubmit.bind(this);

        this.state = {
            username: "",
        }
    }
    render() {
        return (
            <div>
                <p>You are on the Create Users List component!</p>
            </div>
        )
    }
}
